import React from 'react'
import { FlipCardContainer } from "./Styled";
import img from "../assets/folk.png"

function FlipCard() {
  return (
    <FlipCardContainer>
      <div className="flip-card-inner">
        <div className="flip-card-front">
          <img src={img} alt="" width='100%' height='300px' />
        </div>
        <div className="flip-card-back">
          <h1>Album name</h1>
          <h2>Singer</h2>
          <h2>Total Songs</h2>
        </div>
      </div>
    </FlipCardContainer>
  );
}

export default FlipCard
